import React from 'react'
import {Combination} from "js-combinatorics"
let array = [
    {
        num: "1",
        question:"whats you name",
        answer:"shailesh"
    },
    {
        num: "2",
        question:"whats you game",
        answer:"volleyball"
    },
]
function keyCreator(keyquestion){
    const wordsArray = keyquestion.split("")
    const newValue = new Combination(wordsArray , 2)
    console.log(newValue,"newValue")
    console.log("nc")
}
function Formbuild() {
    
    function StructureCreator({num , question,answer}){
        const structure = `
        <label>${num}</label>
        <li>${question}</li>
        <li>${answer}</li>
        `
        
        return <>
         {structure} <br />
         
        </>
    }

  return (
    <div>
        {array.map(item => <>
            <StructureCreator num={item.num} question={item.question} answer={item.answer}/>
        </>)}
       
      
    </div>
  )
}

export default Formbuild
